import React, { Component } from "react";
import comicVine from "../../Data/Requests/comicVineRequests";

export class HomePage extends Component {
  componentDidMount() {
    comicVine.getCharacters();
  }

  render() {
    return (
      <div>
        <h2>HomePage works!</h2>
      </div>
    );
  }
}

export default HomePage;
